const Card = ({ team }) => {
  const teamInfo = [Object.entries(team)];
  const getTeamInfo = id => {
    return (
    <div>
      <p>{teamInfo.name}</p>
      <p>{teamInfo.venue}</p>
    </div>
    )
  };

  return (
    <section className='cards'>
      <div onClick={() => getTeamInfo(team)}>{team.name}</div>
    </section>
  )
};

export default Card;
